import React, { useState, useEffect } from 'react';
import api from '../../api/endpoint';
import { FiActivity, FiCalendar, FiUser, FiCheckCircle, FiClock, FiXCircle } from 'react-icons/fi';

const MesConsultations = () => {
  const [consultations, setConsultations] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    loadConsultations();
  }, []);

  const loadConsultations = async () => {
    try {
      setLoading(true);
      setError(null);
      const data = await api.getData('/consultations/medecin');
      setConsultations(Array.isArray(data) ? data : []);
    } catch (err) {
      console.error('Erreur consultations:', err);
      setError(err.message || 'Impossible de charger les consultations.');
      setConsultations([]);
    } finally {
      setLoading(false);
    }
  };

  const getStatusColor = (statut) => {
    switch (statut) {
      case 'TERMINEE': return 'bg-green-100 text-green-800';
      case 'EN_COURS': return 'bg-yellow-100 text-yellow-800';
      case 'ANNULEE': return 'bg-red-100 text-red-800';
      default: return 'bg-gray-100 text-gray-800';
    }
  };

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleDateString('fr-FR', {
      weekday: 'long',
      year: 'numeric',
      month: 'long',
      day: 'numeric'
    });
  };

  if (loading) {
    return (
      <div className="flex items-center justify-center min-h-[400px] p-6">
        <div className="text-center">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600 mx-auto mb-4"></div>
          <p className="text-lg text-gray-600">Chargement des consultations...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="p-6 max-w-7xl mx-auto">
      <div className="mb-12">
        <h1 className="text-4xl font-bold text-gray-900 flex items-center gap-4 mb-2">
          <FiActivity size={48} className="text-blue-600" />
          Mes Consultations
        </h1>
        <p className="text-xl text-gray-600">({consultations.length} consultations)</p>
      </div>

      {error && (
        <div className="bg-red-50 border-2 border-red-200 text-red-800 px-6 py-4 rounded-2xl mb-8 shadow-lg">
          {error}
        </div>
      )}

      {consultations.length === 0 ? (
        <div className="text-center py-20">
          <FiCalendar size={64} className="mx-auto mb-6 text-gray-400" />
          <h3 className="text-2xl font-bold text-gray-900 mb-2">Aucune consultation</h3>
          <p className="text-lg text-gray-600">Vos consultations apparaîtront ici</p>
        </div>
      ) : (
        <div className="bg-white rounded-3xl shadow-2xl border border-gray-100 overflow-hidden">
          <div className="overflow-x-auto">
            <table className="w-full">
              <thead className="bg-gradient-to-r from-gray-50 to-gray-100">
                <tr>
                  <th className="px-8 py-6 text-left text-sm font-bold text-gray-900 uppercase tracking-wider">Patient</th>
                  <th className="px-8 py-6 text-left text-sm font-bold text-gray-900 uppercase tracking-wider">Date</th>
                  <th className="px-8 py-6 text-left text-sm font-bold text-gray-900 uppercase tracking-wider">Heure</th>
                  <th className="px-8 py-6 text-left text-sm font-bold text-gray-900 uppercase tracking-wider">Statut</th>
                  <th className="px-8 py-6 text-left text-sm font-bold text-gray-900 uppercase tracking-wider">Service</th>
                </tr>
              </thead>
              <tbody className="divide-y divide-gray-200">
                {consultations.map((consultation) => (
                  <tr key={consultation._id} className="hover:bg-gray-50 transition-colors">
                    <td className="px-8 py-6 font-semibold text-gray-900">
                      <div className="flex items-center gap-3">
                        <FiUser size={20} className="text-blue-600" />
                        <span>{consultation.patientId?.fullName || 'N/A'}</span>
                      </div>
                    </td>
                    <td className="px-8 py-6 text-gray-700 font-medium">
                      {formatDate(consultation.dateConsultation)}
                    </td>
                    <td className="px-8 py-6 text-gray-700">
                      {consultation.heureConsultation || 'N/A'}
                    </td>
                    <td className="px-8 py-6">
                      <span className={`px-4 py-2 rounded-full text-sm font-semibold ${getStatusColor(consultation.statut)}`}>
                        {consultation.statut === 'TERMINEE' && <FiCheckCircle className="inline mr-1" size={16} />}
                        {consultation.statut === 'EN_COURS' && <FiClock className="inline mr-1" size={16} />}
                        {consultation.statut === 'ANNULEE' && <FiXCircle className="inline mr-1" size={16} />}
                        {consultation.statut}
                      </span>
                    </td>
                    <td className="px-8 py-6 text-gray-700 font-medium">
                      {consultation.serviceId?.nom || 'Consultation générale'}
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      )}
    </div>
  );
};

export default MesConsultations;
